import { StyledToDoListItem } from "./StyledToDoListItem"
import { useState } from "react"

const defff = {
  id: 1,
  title: "Задача",
  completed: false,
}

export default function ToDoListItem({ object = defff }) {
  const [completed, setCompleted] = useState(object.completed)

  return (
    <StyledToDoListItem onClick={() => setCompleted((prev) => !prev)}>
      <div className={`card ${object.completed ? "bg-success" : "bg-warning"}`}>
        <div className="card-body">
          <h3 className="card-title">{object.title}</h3>
        </div>
      </div>
    </StyledToDoListItem>
  )
}
